.accordion__button:before {

    margin-right: 12px;

    border-right: 2px solid currentColor;
    transform: rotate(-45deg);
}

.accordion__button[aria-expanded='true']::before,
.accordion__button[aria-selected='true']::before {
    transform: rotate(45deg);
}

.accordion__panel {

e button \r\n    Then the trade is displayed in the trade table\r\n    \r\n    @addTradeAndDatabase \r\n    Scenario: As a user, I should be able to add my trade and validate database\r\n    Given I am on the app log in page\r\n    When I enter valid username \"helil\" and password \"SuperHelil123!\"\r\n    And I click on trade signin button\r\n    Then I should be in the trade homepage\r\n    When I click on Add Trade button\r\n    Then I should be on Save Trade Form\r\n    When I enter following trade details\r\n    |Buy to Open|AMZN|06/01/2021|601.05|06/10/2021|622.05|\r\n    And I click save button \r\n    Then the trade input matches with the database record\r\n    \r\n    @databaseInsertToUI\r\n    Scenario: As a user, I should be able to see the record inserted to database\r\n    Given I insert the following record to database\r\n    |205|1|0|SPCE|2021-03-10|3401.05|2021-06-5|3122.05|12.5|\r\n    And I am on the app log in page\r\n    When I enter valid username \"helil\" and password \"SuperHelil123!\"\r\n    And I click on trade signin button\r\n    Then I should be in the trade homepage \r\n    And the trade input displays on UI","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/elysi/git/seleniumCucumberProject/./src/test/resources/features/TradeAppAddTrade.feature","feature":{"location":{"line":2,"column":1},"tags":[{"location":{"line":1,"column":1},"name":"@Regression","id":"1ff7abf6-917f-48bb-8a1a-43638e3ec5ae"}],"language":"en","keyword":"Feature","name":"Add Trade","description":"  User is able to add delete edit the trade logs","children":[{"scenario":{"location":{"line":7,"column":3},"tags":[{"location":{"line":6,"column":3},"name":"@addTrade","id":"efa93d9d-43b6-4a78-837b-dcde75c92367"},{"location":{"line":6,"column":13},"name":"@SmokeTest","id":"911067b2-beb1-4248-848d-b74220a0e633"},{"location":{"line":6,"column":24},"name":"@UpdateTrade","id":"1cd2041a-43fe-4f6e-ad70-21a7df40f7f9"}],"keyword":"Scenario","
